import React from 'react';

const StepTenStatic = () => {
	return (
		<>
			<h2>
				Write down and review your Life Rules, Breakthroughs and Realizatons.
			</h2>
			<p>
				Withe continuous use of thies tool combined with time spent on analyzing
				why and how things happend and how to best deal with them, answers begin
				to form for many of the things you are trying to solve or deal with.
				This sections is alsow where you can keep track of the things you lean
				about yourself and others. This helps to reinforce the positive things
				you have done. And also servers as reminder where you were at how much
				better things can become when you seek solutions to the things that
				bother you or are negatively affect you.
			</p>
		</>
	);
};

export default StepTenStatic;
